import {Route,Routes} from 'react-router-dom';
import Product from './pages/product/product';
import {Home} from './pages/home/home'



function App() {
return 
<Routes>
  <Route path='/' element={<Home/>}/>
  <Route path='/products' element={<Products/>}/>
</Routes>

}

export default App;
